import React from "react";

export const Navbar = () => {
  return <div>
    <div className="nav-container">
      <NavLink to="/home" className="active">Home</NavLink>
      <NavLink to="/about"> IMC Calculator </NavLink>
      <NavLink to="contact"> AGE Calculator </NavLink>
      <NavLink to="myclock"> AGE Calculator </NavLink>
    </div>
  </div>;

};
